import React, { Component } from "react";
import PropTypes from 'prop-types';
import Chart from "react-apexcharts";
import {
  Container,
  Grid,
} from '@material-ui/core';
import TopMenuBar from "../components/TopMenuBar";
import {withStyles} from '@material-ui/core/Button';

const styles = theme => ({
  section1: {
    margin: theme.spacing(3, 2),
  },
});

class Dashboard extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      options: {
        chart: {
          id: "basic-bar"
        },
        xaxis: {
          categories: [1991, 1992, 1993, 1994, 1995, 1996, 1997, 1998, 1999]
        }
      },
      series: [
        {
          name: "series-1",
          data: [30, 40, 45, 50, 49, 60, 70, 91]
        }
      ]
    };
  }
  render() {
    const {classes} = this.props;
    return (
      <Container>
      <TopMenuBar block pageName="Dashboard" hamburgerMenu={false} closeButtonOnly={false} closeWithPrompt={false} backButton={true} backRoutePage="/"/>
        <Grid container direction="column" alignItems="center">
          <Grid item className={classes.section1}>
            <div className="mixed-chart">
              <Chart
                options={this.state.options}
                series={this.state.series}
                type="bar"
                width="500"
              />
            </div>
          </Grid>
        </Grid>
      </Container>
    );
  }
}

Dashboard.propTypes = {
  classes:  PropTypes.object.isRequired,
};

export default withStyles(styles)(Dashboard);
